import Menu from './Menulayout'
import  $ from 'jquery'
import { useState } from 'react';

function Search() {
    localStorage.elems=[]
    const [count,sCount]=useState(0)
    const [drag,setDrag]=useState(null)
    const [element,setElement]=useState(elems(5));
    function elems(c){
        let arr=[];
        
        for(let i=0;i<c;i++){
            arr.push(<div draggable="true" data-key={i} onDragStart={(e)=>{setDrag(e);}}key={i}>{i+1}</div>)
        }
        return arr
    }
    return (
    <div className='searchBody'>
        <div className="mmm">
            {element}
        </div>
        <div className="kk" onDragEnter={()=>{
            sCount(count+1);
            const y=element
            delete y[drag.target.getAttribute('data-key')]
            setElement(y)
            console.log(localStorage.getItem('elems'))

        }}>{count}</div>
    </div>)

}
export default Search;



